$_MODULE['<{psaffiliate}prestashop>vouchers_3f07d5d47a28610d95ff2dce9c495a19'] = 'Bons à partager';
$_MODULE['<{psaffiliate}prestashop>vouchers_87c54f7b3a75e20d72f78c754e56f0af'] = 'Dans cette zone, vous pouvez sélectionner un certain nombre de bons qui seront utilisés comme modèles.';
$_MODULE['<{psaffiliate}prestashop>vouchers_9d309cffbfcc1f37507e6aa747cd0de9'] = 'Les affiliés seront en mesure de générer des codes de réduction basés sur les modèles sélectionnés.';
$_MODULE['<{psaffiliate}prestashop>vouchers_f67dcbe1d448921fc81fe382db040432'] = 'Conseils:';
$_MODULE['<{psaffiliate}prestashop>vouchers_5ca344684899d6591e6c6dfd55db8a0b'] = '1. S\'il vous plaît entrer tous les détails sur les conditions de remise (ex: catégories qui s\'appliqueront à, montant minimum, pays / transporteur / groupe de clients / compatibilité / restrictions du produit ou si elle est disponible uniquement pour un produit spécifique) dans la zone \"description\" de la règle du panier. Cette information ne sera montrée qu\'aux affiliés.';
$_MODULE['<{psaffiliate}prestashop>vouchers_8c5f81ba1faf060085429bb13421b88a'] = '2. Le nom du modèle affiché en face sera le nom de la règle du panier, mais les affiliés pourront insérer un autre nom lorsqu\'ils généreront des bons.';
$_MODULE['<{psaffiliate}prestashop>vouchers_b4dce6ce233354ba7a8e86e815d1ff65'] = '3. Le code sera également généré par vos affiliés, mais il sera préfixé par le code que vous avez entré. Par exemple, si le code de votre règle de panier est \"AFFBEAUTY\" et qu\'un affilié crée un bon avec le code \"FACEBOOKAD\", le code final sera \"AFFBEAUTY_FACEBOOKAD\". Si vous laissez le champ \"Code\" vide, le code final ne sera pas préfixé.';
$_MODULE['<{psaffiliate}prestashop>vouchers_00bb943966006e3fa93cda8e7f8ddbe9'] = '4. \"Valable à partir de\" et \"Valide jusqu\'à\" des vouchers créés par vos affiliés seront exactement les mêmes que ceux que vous avez saisis lors de la création de la règle de panier.';
$_MODULE['<{psaffiliate}prestashop>vouchers_2d47a58e552ae35bb2f5ca314b1a330e'] = '5. La suppression de modèles de règles de panier ou leur désactivation à partir de la zone \"Règles de panier\" affectera les bons existants créés par vos affiliés. Si vous supprimez un modèle de règle de panier ou si vous le désactivez, tous les vouchers créés à partir de ce modèle seront supprimés ou désactivés. Idem si vous réactivez la règle du panier. ATTENTION: La suppression d\'un modèle de règle de panier de cette zone n\'affectera pas les bons existants créés par vos affiliés, si vous ne les désactivez pas à partir de la section \"Règles du panier\".';
$_MODULE['<{psaffiliate}prestashop>vouchers_dd0c357ee26e3e0f161bec4af1e3075f'] = 'Activer le suivi des bons d\'achat';
$_MODULE['<{psaffiliate}prestashop>vouchers_93cba07454f06a4a960172bbd6e2a435'] = 'Oui';
$_MODULE['<{psaffiliate}prestashop>vouchers_bafd7322c6e97d25b6299b5d6fe8920b'] = 'Non';
$_MODULE['<{psaffiliate}prestashop>vouchers_305fd964caa3872a8e8fba4f749fb599'] = 'L\'activation de cette permettra aux visiteurs de suivi par le code de bon qu\'ils ont utilisé. Par exemple, s’ils effectuent un achat à l’aide d’un voucher fourni par l’un de vos affiliés, leur achat sera associé à cet affilié. Cela fonctionne aussi avec une affiliation à vie.';
$_MODULE['<{psaffiliate}prestashop>vouchers_ce2ca6ee0d36c516ce2b4c898274cec0'] = 'Modèles de règles de panier';
